import React from 'react';
import { 
  Paper,
  Typography 
} from '@material-ui/core';

const styles = {
  wrapper: {
    position: 'absolute', 
    left: '50%', 
    top: '50%',
    transform: 'translate(-50%, -50%)'
  } as React.CSSProperties,

  container: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    flexDirection: 'column',
    width: '80vw',
    height: '80vh'
  } as React.CSSProperties,

  column: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-start',
    flexDirection: 'column',
    width: '10vw',
    height: '100%'
  } as React.CSSProperties,

  content: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-start',
    flexDirection: 'column',
    width: '50vw !important',
    height: '100%',
    backgroundColor: 'red'
  } as React.CSSProperties
}

const HomeScreen = () => {
  return (
    <div style={styles.wrapper}>
      <Paper style={styles.container}>
        <div style={styles.column}>
          <Typography 
              variant='h2' 
              component='div'>
                Minha carteira
          </Typography>
        </div>

        <div style={styles.content}>
          aa
        </div>
      </Paper>
    </div>
  );
}

export default HomeScreen;
